import { FiSearch, FiPlus, FiUser } from 'react-icons/fi';
import '../stylesheets/NaviBar.css';

function NaviBar() {
  const goSearch = () => {
    window.location.href = '/search';
  };
  const goProfile = () => {
    window.location.href = '/profile';
  };
  const addPost = () => {
    window.location.href = '/post';
  };

  return (
    <>
      <nav>
        <FiSearch className="search-btn nav-btn" onClick={goSearch} />
        <FiPlus className="post-btn nav-btn" onClick={addPost} />
        <FiUser className="profile-btn nav-btn" onClick={goProfile} />
      </nav>
    </>
  );
}

export default NaviBar;
